import React, { useState } from 'react';
import Book from '../pages/book';

function SearchList({ filteredBooks }) {
    const filtered = filteredBooks.map((item) => <Book item={item} />);
    return (
        <div>
            {filtered}
        </div>
    );
}

export default SearchList;

